**이름:** 제피라 오로라 라이츠 박사

**보안 인가:** 3 (검토 중)

**업무:** 변칙예술 전문가 및 연구원

**활동 기지:** 제43기지

**약력:** 오로라 박사는 섬뜩한 것에 병적으로 매료된 괴짜 변칙예술 마니아이다. 오로라 박사는 단체 //Are We Cool Yet?//의 일원이었으나, 2020년 12월 제43기지를 공격하던 도중 변형된 SCP-2140 개체에 노출되는 일을 겪었다. 이후 오로라 박사는 이력이 개변되어, 소급적으로 2014년부터 활동해 온 재단 연구원이 되었다.

경력 초기에, 오로라 박사는 비밀 현장 요원 및 하급 연구원으로 활동하며 법의학 스케치와 변칙 물체 기록에 자신의 기교를 활용했다. 재단에 합류하기 전 오로라 박사는 [http://scpko.wikidot.com/scp-6113 나이아스를 만나 호수로 이끌려 잠시 물에 얼굴을 비춘 적이 있다]. 성전환 이후, 오로라 박사는 변칙예술계 내에서 여러 인맥을 쌓았고, 결국 ████년에 10년 주기 전시회 //Sommes-Nous Devenus Magnifiques?//에 참석했다.

제 SCP 카드에 쓰인 격리 등급 기호는 [http://scpko.wikidot.com/anomaly-classification-system-guide 변칙성 분류체계 (ACS) 가이드]에서 따왔답니다.

